import './App.css';

function App() {

  return (    
    <div class="login">
      <h1>Hey World!</h1>
      <label for="fname">First name:</label>
      <input type="text" id="fname" name="fname"></input>
      <br></br>
      <label for="Password">Password:</label>
      <input type="password"></input>
      <label for="fname">Last name:</label>
      <input type="text" id="fname" name="fname"></input>
      <br></br>
      <input type="submit" value="Submit"></input>
    </div>
  );
}

export default App;
